import { useNavigate, useLocation } from "react-router-dom";
import "../DetailRoute.css";
import KakaoMap from "../components/KakaoMap";
import { render } from "react-dom";
import WordCloud from "react-d3-cloud";
import DayBtn from "../components/DayBtn";

function DetailRoute() {
  const navigate = useNavigate();
  const location = useLocation();
  const duration = location.state.duration;

  const data = [
    { text: "Hey", value: 1000 },
    { text: "lol", value: 1000 },
    { text: "first impression", value: 800 },
    { text: "very cool", value: 1000 },
    { text: "duck", value: 1000 },
  ];

  return (
    <div className="DetailRoute">
      <div className="about">
        <button id="back" onClick={() => navigate(-1)}>
          {`<`}
        </button>
        <text>자세한 경로는 ... </text>
      </div>
      <div className="info">
        <div id="left">
          <div id="lTop">
           <DayBtn/>
          </div>
          <div id="lMiddle">
            <WordCloud data={data}
            width={200}
            height={100} 
            padding={6}
            fontSize={(word) => Math.log2(word.value) * 2}
            rotate={(word) => word.value % 330}
            font="sunflowerL"/>
          </div>
          <div id="lDown"><button></button></div>
        </div>

        <div id="right">
          <KakaoMap />
        </div>
      </div>
    </div>
  );
}

export default DetailRoute;
